import React from "react";
import DonutChart from "react-donut-chart";

function DoughnutChart() {
  let data = [
    { Value: 73, Label: "Mutual Funds" },
    { Value: 27, Label: "ETFs" },
  ];

  return (
    <DonutChart
      data={[
        {
          label: "Give you up",
          value: 25,
        },
        {
          label: "",
          value: 75,
          isEmpty: true,
        },
      ]}

      colors 
    />
  );
}

export default DoughnutChart;
